func TestTempData(t *testing.T) {
	tempFilepath := path.Join(common.TempDataDir, common.TmpExcelEditorFile)

	// 2. 判断文件是否存在
	if _, err := os.Stat(tempFilepath); err != nil {
		if os.IsNotExist(err) {
			log.Error(err)
			return
		}

		log.Error(err)
		return
	}

	// 3. 读取文件内容
	data, err := os.ReadFile(tempFilepath)
	if err != nil {
		log.Error(err)
		return
	}

	// 4. 解析 JSON（如果你只是想原样返回 string，可跳过这一步）
	wb := new(dataparser.Workbook)
	err = json.Unmarshal(data, wb)
	if err != nil {
		log.Error(err)
		return
	}
	fmt.Println(wb)
}

func TestUploadConfig2Excel(t *testing.T) {
	file, err := excelize.OpenFile("C:\\Users\\admin\\Downloads\\Activity_7084_配置表.xlsx")
	if err != nil {
		log.Errorf("open file failed: %v", err)
		return
	}
	defer file.Close()
	var buf bytes.Buffer
	if _, err := file.WriteTo(&buf); err != nil {
		log.Error(err)
		return
	}
	fileInfo := UploadFile{
		Reader:   &buf,
		Filename: "Activity_7084_配置表.xlsx",
	}
	if resp, err := UploadConfig(fileInfo, "7e7f970e24ae2c8ed409faddd33da72c"); err != nil {
		log.Error(err)
	} else {
		fmt.Println(resp)
	}
}

